import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'



import Home from './components/Home/'

const App = () => {
  return (
    <Router>
        <Routes>
          <Route exact path="/home" element={<Home/>}/>
        </Routes>
    </Router>
  );
}

export default App;
